import React from 'react';
import './index.css';

class App extends React.Component{

    render(){
        return (
            <div className="row">
                <div className="px-5">
                <input
            //   value={name}
                onChange={this.handleChange}
                type="text"
                name="name"
                className="form-control w-30"
              id="InputName"
              aria-describedby="nameHelp"
              placeholder="Enter Name"
            />
            </div>
            <div className="px-5">
            <button
                type="submit"
                className="btn btn-primary btn-color btn-lg btn-block w-50 font-15"
              >
              ADD
              </button>
            </div>
            </div>
        )
    }
}
export default App;
